import React, { Component } from 'react';
import { signOut } from "firebase/auth";
import { auth } from '../../firebase_config'
import { Link } from "react-router-dom";

function Navbar(props) {
    const signingOut = (e) => {
        e.preventDefault();
        signOut(auth).then(() => {
            // Sign-out successful.
            props.userchange(auth.currentUser);
            console.log('bye')
            console.log(auth.currentUser)
        }).catch((error) => {
            // An error happened.
            console.log(error);
        });
    }
    return (
        <div
        className='w-100 d-flex justify-content-end position-absolute align-items-center'
        >
            <Link className="navLink" to="/">
            Home
            </Link>
            <Link className="navLink" to="/signup">
            Inscription
            </Link>
            <Link className="navLink" to="/signin">
            Connexion
            </Link>
            <button className="btn btn-danger mx-5 my-4 rounded rounded-5" onClick={ signingOut }>    
                Sign out {props.username}
            </button>
        </div>
    );
}

export default Navbar;
